import React ,{ useState } from "react"


const [Character , SetCharacter] = useState()


 function MyFetch(API){
    fetch(API)
    .then((res)=>res.json())
    .then((data)=>{
        SetCharacter(prev=> ({ ...data.data,...prev.data}))
        }) 
 }

export default MyFetch
